// src/pages/Lancamentos.js
import React from "react";
import Layout from "../components/Layout";

// Componente da página de Lançamentos
const Lancamentos = () => {
  return (
    // Utiliza o Layout com sidebar e header
    <Layout>
      {/* Conteúdo principal da página */}
      <h2>Página de Lançamentos</h2>
      <p>Gerencie aqui seus lançamentos financeiros.</p>
    </Layout>
  );
};

export default Lancamentos;
